export default class DynamicFormItem
{
    constructor(fieldId, fieldValue, fieldInitValue, fieldTypeId, requestFieldId, requestFormId, isNew, cityName, uniqueId) {
        this.FieldId = fieldId;
        this.FieldValue = fieldValue;
        this.FieldInitValue = fieldInitValue;
        this.FieldTypeId = fieldTypeId;
        this.RequestFieldId = requestFieldId;
        this.RequestFormId = requestFormId;
        this.IsNew = isNew;
        this.CityName = cityName;
        this.UniqueId = uniqueId;
    }
  }
